            if (maybeTrustAnchorCertificate.isPresent()) {
                final Tuple2<URI, byte[]> res = maybeTrustAnchorCertificate.get();
                updatedTrustAnchor = readTrustAnchorFromLocation(res.v2, trustAnchor, res.v1, validationResult);
