                }
                if (dropRatio > dropMaxRatio) {
                    logger.error(String.format("Error ratio (1min avg) %2f has exceeded threshold %f.", dropRatio, dropMaxRatio));
                    return true;
                }
            }
            else {
                logger.trace("Drop rate is still 0.0");
